import React from 'react';
import {BrowserRouter,Route,Switch} from 'react-router-dom';
import Inicio from './pages/Inicio';

export default function routes(){
    return(
        <BrowserRouter>
            <Switch>
                <Route path='/' component={Inicio}/>
            </Switch>
        </BrowserRouter>
    );
}
